import IMG2 from './img/sns-2.png';
import IMG3 from './img/sns-3.png';
import './Footer.css';
import {Link} from 'react-router-dom'

function Footer(){
        return (
        <footer>
            <div id="bottomMenu">
                <ul>
                    <li><Link to="#">회사 소개</Link></li>
                    <li><Link to="#">개인정보처리방침</Link></li>
                    <li><Link to="#">여행약관</Link></li>
                    <li><Link to="#">사이트맵</Link></li>
                </ul>
                <div id="sns">
                    <ul>
                        <li><Link to="https://www.facebook.com/"><img src={IMG1} alt=""/></Link></li>
                        <li><Link to="https://www.youtube.com/"><img src={IMG2} alt=""/></Link></li>
                        <li><Link to="https://www.instagram.com/"><img src={IMG3} alt=""/></Link></li>
                    </ul>
                </div>
            </div>
            <div id="company">
                <p>제주특별자치도 ***동 ****로 *** (대표전화) 123-456-7890</p>
            </div>
        </footer>  
        );
}

export default Footer;
